import { useEffect, useState } from "react";
import CIVIC_INFO_API_KEY from './apiKeys';

function GetFederalReps() {

    const [federalReps, setFederalReps] = useState([]);

    const getData = async () => {

        const apiUrl = 'https://www.googleapis.com/civicinfo/v2/representatives';
        const params = {
            address: '94501',
            includeOffices: true,
            levels: 'country',
            key: CIVIC_INFO_API_KEY,
        };

        const searchParams = new URLSearchParams(params);
        const urlWithParams = `${apiUrl}?${searchParams.toString()}`;

        try {
            const response = await fetch(urlWithParams);
            if (!response.ok) {
                throw new Error(`HTTP error! Status: ${response.status}`);
            }
            const data = await response.json();
            setFederalReps(data.offices.get("U.S. Senator"));
        } catch (error) {
            console.error('Error fetching data:', error);
        }

    };

    useEffect(() => {
        getData()
    }, []);

    console.log(federalReps);

    return (
        <p>{federalReps}</p>
    );
};

export default GetReps;
